import React from 'react';
import { Route, Switch } from 'react-router-dom';
import './App.css';

import Layout from './components/layout/layout';
import Themes from './pages/themes';
import Landing from './pages/landing';
import OceanWave from './pages/oceanWave';

// Height & width
// !localSrorage && landingPage
// Route

function App() {
  return (
    <div className="App">
      <Layout>
        {/* <Landing /> */}
        {/* <OceanWave /> */}
        <Switch>
          <Route path="/" exact={true} component={Themes} />
          <Route path="/ocean" component={OceanWave} />
          {/* <Route path="/mountain" component={OceanWave} />
          <Route path="/rain" component={OceanWave} /> */}
        </Switch>
      </Layout>
    </div>
  );
}

export default App;
